DROP TABLE IF EXISTS `nutritional_information`;
CREATE TABLE `nutritional_information`  (
  `ingredient_id` int NOT NULL COMMENT 'รหัสวัตถุดิบ (Primary Key)',
  `ingredient_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'ชื่อวัตถุดิบ',
  `calories` int NOT NULL COMMENT 'พลังงาน (แคลอรี)',
  `quantity_per_unit` int NOT NULL COMMENT 'ปริมาณต่อหน่วย (กรัม)',
  `protien` double NOT NULL COMMENT 'โปรตีน (กรัม)',
  `fat` double NOT NULL COMMENT 'ไขมัน (กรัม)',
  `carbohydrates` double NOT NULL COMMENT 'คาร์โบไฮเดรต (กรัม)',
  `dietary_fiber` double NOT NULL COMMENT 'ไฟเบอร์ (กรัม)',
  `calcium` double NOT NULL COMMENT 'แคลเซียม (มิลลิกรัม)',
  `iron` double NOT NULL COMMENT 'ธาตุเหล็ก (มิลลิกรัม)',
  `vitamin_c` double NOT NULL COMMENT 'วิตามินซี (มิลลิกรัม)',
  `sodium` double NOT NULL COMMENT 'โซเดียม (มิลลิกรัม)',
  `sugar` double NOT NULL COMMENT 'น้ำตาล (กรัม)',
  `cholesterol` double NOT NULL COMMENT 'คอเลสเตอรอล  (มิลลิกรัม)',
  `image_url` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT 'ลิ้งรูปภาพ',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp COMMENT 'สร้างเมื่อวันที่',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT 'แก้ไขเมื่อวันที่',
  PRIMARY KEY (`ingredient_id`) USING BTREE,
  UNIQUE INDEX `ingredient_id`(`ingredient_id` ASC) USING BTREE COMMENT 'index รหัสวัตถุดิบ'
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'ตารางเก็บข้อมูลโภชนาการ' ROW_FORMAT = Dynamic;

